import React from 'react'
import ReactDOM from 'react-dom'


const NoteExample = (props) => {
  const { notes } = props

  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {notes.map(note => <li>{note.content}</li>)}
      </ul>
    </div>
  )
}

export default NoteExample
